	"method": "GET",
	"headers": {
		"x-rapidapi-host": "movie-database-imdb-alternative.p.rapidapi.com",
		"x-rapidapi-key": "250663e058msh13644a738a1faf5p1fb96fjsn6c114e18c871"
	}
    })
    .then(response => {
    	console.log(response);
        return (
            <div>
                {props.value.imdb_id}
            </div>
        )
    })
    .catch(err => {
    	console.error(err);
    });
}

export default Imdb
